import Head from 'next/head';

const Meta = () => (
    <Head>
    <meta name="viewport" content="width=device-width, initial-scale=1" />
    <meta charSet="utf-8" />
    <link rel="stylesheet" type="text/css" href="/static/styles.css" />

    <title>Doggos</title>
    </Head>
);

export default Meta;
